    // Execute limit order
    function executeNftOrder(
        uint _orderType,
        address trader,
        uint pairIndex,
        uint index,
        uint nftId,
        uint nftType
    ) public notDone {
        // (
        //     uint _orderType,
        //     address trader,
        //     uint pairIndex,
